import React from 'react';
import { Route, Routes } from 'react-router-dom';
import Protected from './components/Protected';
import { AuthContextProvider } from 'c.ontext/AuthContext';
import Account from 'pages/Account';
import Home from './pages/Home';
import Signin from './pages/Signin';
import ListHome from "./components/ListHome";
import Spanish from "./components/Spanish"
import French from "./components/French";
import Portuguese from "./components/Portuguese";

function App() {
  return (
    <div>
      <AuthContextProvider>

        <Routes>
          <Route path='/' element={<Home />} />
            <Route path="/ListHome" element={<ListHome />} />
            <Route path="/Spanish" element={<Spanish />} />
            <Route path="/French" element={<French/>} />
            <Route path="/Portuguese" element={<Portuguese/>} />
          <Route path='/signin' element={<Signin />} />
          <Route path='/account' element={
              <Protected>
                <Account />
              </Protected>
            }/>
        </Routes>
      </AuthContextProvider>
    </div>
  );
}

export default App;
